import truckQuality from '../assets/truck-quantity-background.png';
import truckProfit from '../assets/truck-profit-background.png';

function TransitDetail(props) {    
 
    return (
        <div >           
            <div>
                <div
                    className="quantity"
                    style={{
                        background: `url("${truckQuality}")`
                    }}
                >
                    <div className="quantity_amount">
                        {8534}
                    </div>
                    <div className="quantity_detail">
                        Shipped Annually
                    </div>
                </div>
                <div className="cost">
                    <div className="quantity_amount">
                        {17348} $
                    </div>
                    <div className="quantity_detail">
                        Annual shipping cost
                    </div>
                </div>
                <div
                    className="profit"
                    style={{
                        background: `url("${truckProfit}")`
                    }}
                ></div>

            </div>   
        </div>       
    );
}

export default TransitDetail;
